import React from 'react'

const Header = () => {
    return (
        <div id="home" className="top-picture">
                <header>
            <div className="container" id="header-space">
                <div className="masthead-subheading">Welcome To My Humble Nest!</div>
                <div className="masthead-heading text-uppercase">It's Nice To Meet You</div>
                <a className="btn btn-primary btn-xl text-uppercase" href="#about"><span className="about-me-size">About Me</span></a>
            </div>
            </header>
        </div>
    )
}

export default Header;
